package com.zhzx.dao.bean.order;import com.zhzx.dao.bean.BaseBean;public class OrderInfo extends BaseBean {		/**	*订单编号	*/	private String id;		/**	*客户编号	*/	private String custNo;		/**	*地址编号	*/	private String addNo;		/**	*状态（1:生成订单，2：等待发货，3：完成，-1:订单取消，-2：订单过期）	*/	private String status;		/**	*	*/	private String createTime;		/**	*	*/	private String updateTime;			public String getId() {	    return this.id;	}	public void setId(String id) {	    this.id=id;	}	public String getCustNo() {	    return this.custNo;	}	public void setCustNo(String custNo) {	    this.custNo=custNo;	}	public String getAddNo() {	    return this.addNo;	}	public void setAddNo(String addNo) {	    this.addNo=addNo;	}	public String getStatus() {	    return this.status;	}	public void setStatus(String status) {	    this.status=status;	}	public String getCreateTime() {	    return this.createTime;	}	public void setCreateTime(String createTime) {	    this.createTime=createTime;	}	public String getUpdateTime() {	    return this.updateTime;	}	public void setUpdateTime(String updateTime) {	    this.updateTime=updateTime;	}}